import React from 'react';


function eventCard(props) {




    return (
        <div >
            <img src={props.favor.r_pic} alt="" />
            <h1 >{props.favor.r_name}</h1>
            <h1 >{props.favor.r_phone}</h1>
            <h1 >{props.favor.r_address}</h1>
        </div>
    )
}

export default eventCard;
